import React, { useEffect } from 'react';
import { connect } from 'react-redux';
import { getRecipes } from '../../actions/recipe';

const CategoryRecipes = ( recipe, getRecipes) => {
    useEffect(() => {
        getRecipes();
    }, [getRecipes]);


    return (
        <div>
            Recipe Overview
        </div>
    )
}

const mapStateToProps = state => ({
    recipe: state.recipe
})

export default connect(mapStateToProps, { getRecipes })(CategoryRecipes);
